(window.webpackJsonp=window.webpackJsonp||[]).push([[55],{"./src/EmailTemplates/Source/notification.html":function(n,t){n.exports='<!doctype html>\n<html>\n<head>\n<meta name="viewport" content="width=device-width">\n<meta http-equiv="Content-Type" content="text/html; charset=UTF-8">\n<title>dhatlas email template</title>\n<style>\n/* -------------------------------------\n    GLOBAL\n------------------------------------- */\n\nimg {\n  max-width: 600px;\n  width: auto;\n}\n\nbody {\n  margin: 0;\n  padding: 0;\n  width: 100% !important;\n  height: 100%;\n  font-size: 100%;\n  font-family: "Helvetica Neue", "Helvetica", Helvetica, Arial, sans-serif;\n  line-height: 1.6;\n  color: #212121;\n  -webkit-font-smoothing: antialiased;\n  -webkit-text-size-adjust: none;\n}\n\n\n/* -------------------------------------\n    ELEMENTS\n------------------------------------- */\na {\n  color: #283593;\n  text-decoration: none;\n  word-break: break-all;\n}\n\n.btn-primary {\n  margin-bottom: 20px;\n  width: auto !important;\n}\n\n.btn-primary td {\n  border-radius: 5px;\n  background-color: #283593;\n  vertical-align: top;\n  text-align: center;\n  text-transform: uppercase;\n  font-size: 14px;\n  font-family: "Helvetica Neue", Helvetica, Arial, "Lucida Grande", sans-serif;\n  /* box-shadow */\n}\n\n.btn-primary td a {\n  display: inline-block;\n  padding: 12px 12px;\n  border: 0;\n  border-radius: 5px;\n  background-color: #283593;\n  box-shadow: 0 2px 5px 0 rgba(0, 0, 0, 0.26);\n  color: #FFFFFF;\n  text-decoration: none;\n  font-weight: bold;\n  line-height: 1;\n  cursor: pointer;\n}\n\n.last {\n  margin-bottom: 0;\n}\n\n.first {\n  margin-top: 0;\n}\n\n.center {\n  margin-left: auto;\n  margin-right: auto;\n}\n\n.padding {\n  padding: 10px 0;\n}\n\n/* -------------------------------------\n    TOPNAV\n------------------------------------- */\ntable.topnav-wrap {\n  background-color: #283593;\n  width: 100%;\n  height: 50px;\n  color: #FFFFFF;\n}\n\ntable.topnav-wrap td {\n  padding: 0 20px;\n}\n\n.logo strong {\n  display: inline-block;\n  margin-top: 5px;\n  width: 163px;\n  height: 22px;\n  border: 0;\n  background: transparent url("images/dha-logo@2x.png") 0 0 no-repeat;\n  /*---*/\n  background-color: transparent;\n  -webkit-background-size: 163px 22px;\n  background-size: 163px 22px;\n  color: transparent;\n  text-shadow: none;\n}\n\n.link {\n  text-align: right;\n}\n\n.link a {\n  color: #FFFFFF;\n  text-decoration: none;\n  font-size: 12px;\n}\n\n/* -------------------------------------\n    HEADLINE\n------------------------------------- */\ntable.headline-wrap {\n  width: 100%;\n  color: #283593;\n  text-align: center;\n}\n\ntable.headline-wrap h2 {\n  margin: 30px 0;\n}\n\n\n/* -------------------------------------\n    BODY\n------------------------------------- */\ntable.body-wrap {\n  width: 100%;\n  padding: 0 20px;\n}\n\ntable.body-wrap .container {\n  padding: 50px;\n  -webkit-box-shadow: 0px 1px 5px 0px rgba(0, 0, 0, 0.2), 0px 2px 2px 0px rgba(0, 0, 0, 0.14), 0px 3px 1px -2px rgba(0, 0, 0, 0.12);\n  -moz-box-shadow: 0px 1px 5px 0px rgba(0, 0, 0, 0.2), 0px 2px 2px 0px rgba(0, 0, 0, 0.14), 0px 3px 1px -2px rgba(0, 0, 0, 0.12);\n  box-shadow: 0px 1px 5px 0px rgba(0, 0, 0, 0.2), 0px 2px 2px 0px rgba(0, 0, 0, 0.14), 0px 3px 1px -2px rgba(0, 0, 0, 0.12);\n}\n\ntable.body-wrap .container-bg-1 {\n  background: #FFFFFF url("images/bg-icon-1.png") center bottom no-repeat;\n  /*---*/\n  -webkit-background-size: 44% auto;\n  background-size: 44% auto;\n}\n\ntable.body-wrap .container-bg-2 {\n  background: #FFFFFF url("images/bg-icon-2.png") 40% bottom no-repeat;\n  /*---*/\n  -webkit-background-size: 44% auto;\n  background-size: 44% auto;\n}\n\n\n/* -------------------------------------\n    FOOTER\n------------------------------------- */\ntable.footer-wrap {\n  clear: both !important;\n  width: 100%;\n  margin: 0 0 20px;\n  padding: 0 20px;\n  font-size: 12px;\n}\n\n.footer-wrap .container p {\n  color: #9D9D9D;\n  font-size: 10px;\n  line-height: 1.4;\n}\n\ntable.footer-wrap ul {\n  margin: 20px;\n  padding: 0;\n  font-size: 12px;\n}\n\ntable.footer-wrap ul li {\n  display: inline-block;\n  margin: 0 10px 10px;\n  list-style-type: none;\n}\n\ntable.footer-wrap a {\n  color: #9D9D9D;\n  text-decoration: underline;\n}\n\n\n/* -------------------------------------\n    TYPOGRAPHY\n------------------------------------- */\nh1,\nh2,\nh3 {\n  margin: 40px 0 20px;\n  color: #283593;\n  font-weight: 500;\n  font-family: "Helvetica Neue", Helvetica, Arial, "Lucida Grande", sans-serif;\n  line-height: 1.2;\n}\n\nh1 {\n  font-size: 40px;\n}\nh2 {\n  font-size: 30px;\n}\nh3 {\n  font-size: 20px;\n}\n\np,\nul,\nol {\n  margin-bottom: 20px;\n  font-weight: normal;\n  font-size: 14px;\n}\n\nul li,\nol li {\n  margin-left: 5px;\n  list-style-position: inside;\n}\n\n/* ---------------------------------------------------\n    RESPONSIVENESS\n------------------------------------------------------ */\n.container {\n  display: block !important;\n  clear: both !important;\n  margin: 0 auto !important;\n  max-width: 600px !important;\n}\n\n/* Outlook compatibility */\n.body-wrap .container,\n.headline-wrap .container  {\n  padding: 0 20px;\n}\n\n.content {\n  display: block;\n  margin: 0 auto;\n  max-width: 600px;\n}\n\n.content table {\n  width: 100%;\n}\n\n</style>\n</head>\n\n<body bgcolor="#E3EAEF">\n\n\x3c!-- topnav --\x3e\n<table class="topnav-wrap" width="100%" height="50px" bgcolor="#283593">\n  <tr>\n    <td class="logo"><strong>Digital Health Atlas</strong></td>\n    <td class="link"><a href="http://dhatlas.org">Visit dhatlas.org</a></td>\n  </tr>\n</table>\n\n\x3c!-- headline --\x3e\n<table class="headline-wrap" width="100%">\n  <tr>\n    <td class="container">\n      <div class="content">\n        <table>\n          <tr>\n            <td>\n              <h2>Thank you!</h2>\n            </td>\n          </tr>\n        </table>\n      </div>\n    </td>\n  </tr>\n</table>\n\n\x3c!-- body --\x3e\n<table class="body-wrap" bgcolor="#E3EAEF">\n  <tr>\n    <td></td>\n    <td class="container container-bg-2" bgcolor="#FFFFFF">\n\n      \x3c!-- content --\x3e\n      <div class="content">\n      <table>\n        <tr>\n          <td>\n            <h3 class="first">You\'ve been added to a group!</h3>\n            <p>Lorem ipsum dolor sit amet, consectetur adipisici elit, sed eiusmod tempor incidunt ut labore et dolore magna aliqua. Quam temere in vitiis, legem sancimus haerentia. Prima luce, cum quibus mons aliud  consensu ab eo.</p>\n\n            \x3c!-- button --\x3e\n            <table class="btn-primary last" cellpadding="0" cellspacing="0" border="0">\n              <tr>\n                <td>\n                  <a href="#">Go to My Profile</a>\n                </td>\n              </tr>\n            </table>\n            \x3c!-- /button --\x3e\n\n          </td>\n        </tr>\n      </table>\n      </div>\n      \x3c!-- /content --\x3e\n\n    </td>\n    <td></td>\n  </tr>\n</table>\n\x3c!-- /body --\x3e\n\n\x3c!-- footer --\x3e\n<table class="footer-wrap">\n  <tr>\n    <td></td>\n    <td class="container">\n\n      \x3c!-- content --\x3e\n      <div class="content">\n        <table>\n          <tr>\n            <td align="center">\n              <ul>\n                <li><a href="http://dhatlas.org">Go to website</a></li>\n                <li><a href="http://dhatlas.org/#">Terms of services</a></li>\n                <li><a href="mailto:">Contact us</a></li>\n              </ul>\n              <p><b>Disclaimer:</b> All reasonable precautions have been taken by the World Health Organization to verify the information contained in this publication. However, the published material is being distributed without warranty of any kind, either expressed or implied. The responsibility for the interpretation and use of the material lies with the reader. In no event shall the World Health Organization be liable for damages arising from its use.</p>\n            </td>\n          </tr>\n        </table>\n      </div>\n      \x3c!-- /content --\x3e\n\n    </td>\n    <td></td>\n  </tr>\n</table>\n\x3c!-- /footer --\x3e\n\n</body>\n</html>\n'}}]);